  constructor(props) {
    super(props)
    this.state = {
      items:[],

    }
  }
  render() {
    return (
      [
      <div></div>,
      <FormalListInput></FormalListInput>,
      <FormalListItem></FormalListItem>
      ]
    )
  }

}

export default FormalListApp;
